import React from "react";
import styled from "styled-components";
import Footer from "../Footer";
import D20Icon from "../../Images/Dice/D20Icon";

const Container = styled.div`
  background-color: #252525;
  width: 99vw;
  height: calc(100vh - 75px);
  text-align: center;
  margin: 0 auto;
`;

const OutlineBackgroundContainer = styled.div`
  padding-top: calc(50vh - 250px);
`;

const LoginBox = styled.div`
  width: 80vw;
  max-width: 600px;
  min-height: 375px;
  height: 50vh;
  max-height: 450px;
  margin: 0 auto;
  text-align: center;
  background-color: rgba(255, 255, 255, 0.4);
  border: 4px solid #fff;
  border-radius: 5px;
  position: fixed;
  top: 50vh;
  left: 50vw;
  transform: translate(-50%, -55%);
`;

const Login = () => {
  return (
    <div>
      <Container>
        <OutlineBackgroundContainer>
          <D20Icon width={350} button={true} outline={true} />
        </OutlineBackgroundContainer>
        <LoginBox />
      </Container>
      <Footer />
    </div>
  );
};

export default Login;
